%alles loaden
load lengte.mat
load test1.mat
load test2.mat
load test3.mat

f = [f1; f2; f3];
lSI = l * 0.01;
figure(1) %[output:02789fdc]
hold on %[output:02789fdc]
legends = {};
vc = 0;
%for loop voor alle metingen te plotten
for j=1:3 %[output:group:03823435]
    
    kracht = f(j,:);
    scatter(lSI,kracht,'x') %[output:02789fdc]
    fitj = fit(lSI',kracht', "poly1") %[output:9ff8e336] %[output:468e3541] %[output:1dda4338]
    plot(fitj) %[output:02789fdc]
    legends = [legends {"metingen reeks " + j, "fitted curve reeks " + j}];
    %plot(fitj, lSI, kracht)
    disp("de veerconstante is: ") %[output:085c744c] %[output:3e886e46] %[output:45410dba]
    disp(fitj.p1 + "N/m") %[output:2ab0a350] %[output:9925fecf] %[output:135b9764]
    vc = vc + fitj.p1;
end %[output:group:03823435]
%plot settings
ax = gca %[output:7a3c1c83]
xtickformat('%.3f'); %[output:02789fdc]
ytickformat('%.1f' ); %[output:02789fdc]
ax.FontSize = 8; %[output:02789fdc]
xlim([lSI(1)-0.01 lSI(end) + 0.01]); %[output:02789fdc]
legend(legends) %[output:02789fdc]
xlabel('Lengte elastiek L (m)' ); %[output:02789fdc]
ylabel('Trekkracht F (N)' ); %[output:02789fdc]
legend('Location' ,'northwest' ); %[output:02789fdc]
legend('boxoff' ); %[output:02789fdc]
vc = vc/height(f);
disp("de veerconstante(gem) is: ") %[output:5686b6b5]
disp(vc + "N/m") %[output:67518840]



